import { Platform, StatusBar as RStatusBar, StyleSheet } from 'react-native';

const styles = StyleSheet.create({
    headingContainer: {
        display: 'flex',
        textAlign: "center",
        backgroundColor: '57068C',

    },

    header: {
        padding: '20px',
    },

    spaces: {
        display: "flex",
        flexWrap: "wrap",
        flexDirection: "column",
    },
    buttons: {
        backgroundColor: 'grey',
        marginLeft: '5%',
        marginRight: '5%',
        padding: '20%',
        borderRadius: '30px',
        textAlign: "center",
        width: "40%",
    },
});

export default styles;
